sources.components\\buttons\\buttons.scss:
.button {
	display: inline-block;
	border-radius: 22px;
	cursor: pointer;
	font-weight: bold;
	font-size: 12px;
	line-height: 15px;
	text-transform: uppercase;
	transition: all 0.4s ease;
	background-color: transparent;
	padding: 0;
}

.button-primary.clicked-button {
	background: $color-purple-gradient25;

}

.clicked-button {
	.button-secondary__outer {
		background: $color-purple-gradient25;
	}
}

.button-primary {
	background: $color-purple-gradient;
	color: #fff;
	padding: 15px 20px;

	&:hover {
		background: $color-purple-gradient25;
	}

	&--small {
		padding: 9px 19px;
	}
}

.button-secondary {
	color: $color-purple;
	border-radius: 50px;
	padding: 2px;
	position: relative;
	z-index: 1;

	&:hover {
		.button-secondary__outer {
			background: $color-purple-gradient25;
		}
	}

	&--small {
		padding-top: 8px;
		padding-bottom: 7px;
	}

	&__inner {
		line-height: 15px;
		padding: 12px 18px;
		border-radius: inherit;
		background-color: #fff;

		&--small {
			padding: 7px 17px;
		}
	}

	&__outer {
		position: absolute;
		top: 0;
		left: 0;
		right: 0;
		bottom: 0;
		z-index: -1;
		border-radius: 50px;
		background: $color-purple-gradient;
		transition: all 0.4s ease;
	}

	&--wider {
		.button-secondary__inner {
			padding-left: 24px;
			padding-right: 24px;
		}
	}
}

.button-single {
	color: $color-purple;

	&:hover {
		color: #8BA4F9;
	}
}

.button-single-dark {
	color: $color-ds50;

	&:hover {
		color: $color-ds75;
	}
}

.button-wide {
	@extend .button-primary;
	width: 100%;
	display: block;
	text-align: center;
	position: relative;

	&__arrow {
		display: block;
		position: absolute;
		right: 10px;
		top: 10px;
	}
}
